import React , { Component } from 'react'

class CustomerData extends Component {
    constructor (props){
        super(props)
        }
    render() {
        return(
            <div>
                Customer Details
                {this.state.listItems.map((item,index) => { 
                return (
                <p key={index}>
                    value={item.name}
                    value={item.perc}

                </p>
                )
                })}
            </div>

        )
    }
}

export default CustomerData
